INSERT INTO `review` VALUES (1,793,1947,1.00,'2012-09-15','The food is quite good, especially the cornbread and burger.  If this review was solely based on that, it would be a solid 4 stars. Unfortunately, I have to downgrade because they served my husband the lobster whipped potatoes with his salmon even though we informed our waiter that he is allergic to shellfish. Our waiter write down regular mashed potatoes, but the kitchen apparently didn\'t read the order carefully. My husband broke out in a rash as soon as we got home. Thankfully, my husband\'s allergic reaction is limited to rashes only, but that is not the case for many people with food allergies.  Perhaps it\'s because they just opened and are still ironing out the wrinkles, but that is really no excuse for serving people food they are allergic to after being informed of those allergies.'),(2,1551,1372,1.00,'2012-10-03','Cons:1. We were seated 10 minutes before happy-hour ended, but were not greeted by a waitress until it was too late to order.2. I had to ask 3 times for another drink before either waitress would bring me one, and then was overcharged on my bill for an incorrect number of beers. Just because I asked 6 times for a beer, I only actually ordered 3. This does not give you permission to charge me for 6 beers.3. None of the food came out at the same time. There was a 10-minute gap between when the first plate came out and when the last plate came out.4. The quality of the food was poor to say the least. $7 for a salad that was no bigger than the bowl of cereal I ate this morning is unacceptable. Also, the creations found in the selection for the bruschetta board reminded me of when my 4 year-old nephew made his own lunch one day; \"Nacho cheese with sliced dates covered in crushed-up Dorito chips\"Pros:1. None of my party has contracted Dysentery.2. They serve alcohol3. I was able to beg and plead and get at least 3 drinks from the watiress.4. I was able to spend time on the patio with my family.Overall:Next time we will know better...'),(3,1716,1788,1.00,'2013-03-04','We were quite excited to find a facility that offered \'puppy socialization\' but the excitement quickly turned to disappointment last week when we brought our 16-week old to a session (BTW, our pup is only about 22 pounds, hardly a \"bruiser\").  The idea is to allow the puppies to play and interact with each other; however, before the class began, the owner took our dog, along with another puppy (about the same size dog) and, without explanation, kept both puppies on leashes, severely limiting their ability to play with the other dogs.  Note - neither our dog or the other showed any sign of being aggressive or too \'physical\' - they were both showing normal if not subdued behavior for puppies.  What was most distressing was that, while he was limiting their ability to play, he actually dragged our dog (flipping him over a time or two against my puppy\'s will) while he was looking elsewhere at other dogs.  He kept the two dogs on leashes for the entire session so they barely had a chance to play without any explanation why.  What was particularly galling is, halfway through the session, he gave our dog back to us to keep with us (doing the same with the other puppy) while he and his staff sat on the floor in the middle of the room with all the other puppies and played/interacted with them.  We were made to feel like our dog was abnormal or a problem - it was quite insulting.  The advice I would give is, if your dog is over 10 pounds, don\'t bother....they doted on the very small dogs.'),(4,221,823,1.00,'2013-03-22','I ordered a burger and some fries. Oddly, they do not accept any other form of payment other than cash. Burger was very dry and lacking any kind of seasoning. Bun was heated on the grill and tasted meaty.  Took 2 bites and literally threw away burger! Also fries were burnt looking. If I could give a rating of 0, I would, but Yelp only allows a minimum of 1 star.'),(5,1368,1368,1.00,'2014-02-15','My wife and I tried to have dinner at Public House last night.I ordered a bottled beer. The waiter placed the beer glass on the table as he opened the beer. I noticed that the glass was dishwasher hot. How that escaped the attention of the waiter is beyond me. I asked that he swap out the hot glass with a cold one.We started with a beet and endive salad to share. We received a small plate containing 5 slices of a beet and a few dime sized slivers of endive. All this for the absurdly high price of $13. We voiced our discontent to our usually helpful waiter. The manager brought over another smaller plate containing more endive, but no beets.For our entrees my guest selected their Scottish salmon ($26) and I ordered a Pub Burger ($19).Instead of fries I asked for something not so greasy. The waiter suggested sliced tomatoes. Perfect. I ordered the burger cooked medium rare. I also asked that they serve the aioli on the side. I received the fries which were cold, instead of the tomatoes i ordered. Further, the burger was as cold as the fries and the aioli was absent. Since we had theater tickets in hand for a fast approaching curtain, I returned the dish.My guest is on a low fat diet. She asked the waiter to provide plain quinoa instead of creamy quinoa and plain brussels sprouts instead of them roasted in butter. The salmon was ordered \"medium\". The dish arrived with the salmon cooked rare and the sprouts cooked hard raw. We sent the dish back along with my burger.The manager appeared again to apologize and to present his business card so that he could ensure a better experience should we elect to return. Overall the service was reasonable. Our waiter never asked us if we would like another drink (beer and a cocktail), which were finished with our salad.They gave us our check for 2 drinks and the salad. Paid and departed for the theater.'),(6,537,356,1.00,'2014-12-03','this spedo shop has gone down hill in the last couple months ,ive been sending work here for many years 10 and now that they have changed hands customer service sucks,they close whenever they want dont return phone calls,i have had a cluster sent there for a week not even an update then the owner calls me for wiring diagrams,said he went home sick i have a customer waiting for her car and the spedo shop hasnt even tried to call me with a solution this place sucks never sending any work here again,.'),(7,1233,1781,1.00,'2015-02-13','The 1st time I went to Oreganos on Dobson and Southern, food was amazing so next time I decided to try the one on Gilbert Road. I did not care for the brushetta as the tomato pieces were too big so that they did not stay on the bread and the veggie sandwich had no taste to it and too big to bite on. The hot wings were too hot. The food was not as good at the Dobson branch. The service was good- friendly but the food put me off of going to it again. S.T.'),(8,1051,895,1.00,'2015-03-14','This other table was being disruptive, and told their kids they were going to beat them.  We nicely said, \"Please keep it down, you\'re cussing in front of our kids.\" She then threatened to kick our butts, and beat OUR kids! We told the manager, and they said \"Maybe she\'s crazy.\" No apology or anything. Very unprofessional.'),(9,1746,723,1.00,'2015-05-11','The waitress out here Erika is super rude. She  accused me of being there three weeks ago and misbehaving even though i was going there for the first and last time. When i said i am here for the food she said the kitchen was closed. When i said i was for the prime rib event and have a ticket she still refused to let me in and not even offer me a refund, cause i didn\'t want to eat there anymore. Finally she let me in upon showing the ticket on my app and getting really adamant to understand what the issue was. I really did not appreciate being treated like shit. No wonder the place was empty.'),(10,1699,923,1.00,'2015-06-10','Last night me and my two friends stopped to get couple tacos before going home.  Not only everything did not taste good. Today all 3 of us suffering from food poisoning.'),(11,753,1886,1.00,'2015-09-05','This location is CLOSED.According to the HairMasters website, they no longer have any locations in Nevada.There is a Supercuts in the same shopping center (Smith\'s, at Lake Mead and Rampart).  In fact, if you call the number listed here for HairMasters, it will currently ring at Supercuts.'),(12,1688,633,1.00,'2015-10-05','Me and my husband went to T-mobile last night, and we got there at 6:50pm. On google maps it says this location closes at 6pm. But since we were in the area we went to look, and when we pulled up it looked still open. And on the glass it said Sunday closing time is 8:00pm. So we parked and started to get out of the car and we seen one of the tmobile workers run over to the front of the store and start pulling down all of the shades and looking out at us standing right in front of the door. Another tmobile worker walked out of the back. And we were yelling through the window, \"are you closing?\" And he just shrugged his shoulders and nodded his head. While the woman that pulled all the shades down was pressing her face against the wired fence looking at us and laughing, like we couldn\'t see her. I just felt it was extremely rude of them to purposely run up and lock it up at 6:55-ish. When it says they close at 8:00pm on the front door. And laugh at us. Luckily there are more than one tmobile in our area. Because I will definitely make it an appoint to not go to this one.'),(13,1595,1881,1.00,'2015-12-22','Worst service ever. They are too busy packing up 30mins before closing time and just never called us for our order. No one is in the store and couldn\'t even tell us the order has been ready for a good 10 mins already. I highly do not recommend this StarBucks!'),(14,1809,43,1.00,'2016-01-14','Sub-par location, basically a satellite drop with terrible \'customer service\' if you can even call it that. I was excited to see there was a new location since I live in Old Town & all I had was one white coat that happened to have a few coffee spots on the right sleeve. For starters, they wouldn\'t accept the coupon I had been given from the Frank Lloyd location (even though it doesn\'t indicate \'Must be used at ___ location\' anywhere on it. Then, when I went to pick it up yesterday, I checked the coffee spots & they were ALL still there - even though I asked the guy nicely upon drop off to please use the stickers to mark the spots. Apparently that didn\'t happen & the woman working told me & I quote \"...sometimes we just can\'t get coffee out.\"  I\'m sorry, but coffee is water-based & I didn\'t touch the spots with any product so to me that\'s a ludicrous response!  With her less than friendly attitude, she offered to re-do the jacket (with no guarantees of course). I went to pick it up again today (since I received an email indicating it was ready) and before she even looked, she being the same surly girl from the day before, she told me it might not even be ready yet.  Really?!? Thanks.  Thankfully it was ready & low & behold the 5 stickers I made her put on the jacket must have worked because the stains were magically gone!  I\'m sorry, but I shouldn\'t have to work this hard to get a few tiny specs of coffee out of a white jacket!  If you value your time & sanity, you\'re better off driving the extra miles to the FLW location.'),(15,282,1131,1.00,'2016-04-26','Edit: I have been actively avoiding this place for months and it has been great. AMF Chandler lanes is just about 10 minutes away and it is astonishing how much cheaper AMF is. Plus, AMF isn\'t always cosmic bowling with a ton of distractions so that has been great as well. Never coming back here. They are losing so much money from their greed. ---I am a really avid bowler so I thought it would be fun to come here on my birthday. I was wrong. I have never been to a place so anti-consumer as this one. Allow me to explain:I came here on Saturday, April 23rd with a group of 4 people. If you weren\'t aware, there was a large fire in the area that day. The fire was so big that it made national news. The police shut down Gilbert from Warner to Ray so we could not leave the bowling alley. This also meant that nobody could enter the bowling alley either. The place was pretty dead and our (extremely expensive) time was almost up on our lane. We wanted to get some more time on our lane so that we could at least bowl to kill time until they opened the road again. At this point, we have been giving this place a lot of money. We had purchased 3 pitchers of beer, 4 shots of tequila, and 2 glasses of wine and food. How much would you expect another hour of bowling to be if we were stuck there and they were not gaining any new customers? $15? $20? Free since it was my birthday and we couldn\'t leave? Wrong. They had the audacity to offer us 30 more minutes of bowling for $40. This is only for 4 people. That isn\'t even enough time for a full game. I have never heard of such insane prices in all of my years of bowling. They totally took advantage of the fact that we were stuck there. We had to actually negotiate with them to get them to bring that price down. Totally ridiculous. Not only that though, we had a lane open right next to us the whole night. There were a couple slow bowlers in the group so we kindly asked them to open that lane up as well. Nope. They wouldn\'t do it. It would have cost them nothing to open it up but they didn\'t do it anyway. I have never had that problem at AMF or any other bowling company when I have asked. Especially when the place was so dead. They had the opportunity to keep us there so that we keep buying drinks, but they were so greedy that they wouldn\'t do anything to help the customer out. It really seemed like they did not want us to be there. Really dumb move by them in the end though. I used to come to this alley all the time and they could have made so much more money off of me. Now I will gladly take my business to AMF from now on. AMF is much cheaper and they have better lanes anyway. The only reason I came here was because it was close to my house. If you are reading this, please consider going somewhere else. You will not have a good experience here. I have never had such a bad experience at a bowling alley, and they really made my birthday the exact opposite of fun.'),(16,239,742,1.00,'2016-05-09','Came here for mother\'s day dinner. We knew it was going to be a busy night for the restaurant so we expected slow service.  We have come to blue lagoon many times before since it is one of the most decent chinese restaurants in the area: but tonight\'s experience made us decide not to come back ever again!Food: because it was mothers day, the restaurant made you to order from their \"special mothers day\" menu; which are all expensive set courses. So you stuck with ordering crabs and lobsters  ( min $250+ for 4 ppl ).Service: no service.  No tea, no water, took 20 mins to finally order the food. Waited 20+ mins for EACH dish to come out. Still no tea, no water. The food came out so slow we decided to get the last few dishes to go. When we asked for the bill we asked if we can get the regular dessert that came with the food; they never come. Although it did take the server less than one minute to get the bill!Aviod this place!!'),(17,1924,441,1.00,'2016-06-22','As a rule I try not to post negative reviews but there is a lady that works here that is completely out of line her customer service is insane terrible we went in to look at sofa\'s but didn\'t want anyone fallowing us around so when we walked in we where greeted by a woman who asked what she could do for us we told her we where just looking around she didn\'t get so then she proceeded to ask us what we where looking for we told her again we where just looking she then gave us a dirty look and started walking away talking smack about us to the other employees standing by the entrance like vultures needless to say we left and went to Ashley\'s up the road where the customer service was amazing and we got an entire living room set so thank you walker for your terrible customer service'),(18,239,119,1.00,'2016-09-08','Terrible service. This is an experience I must share.We were seated quite quickly given that it was on a long weekend. I wanted to try the monster or pig egg yolk steamed buns. When I asked the staff if they had the buns, she said yes. After being seated, we were left to order on the menu sheets. We also asked for Tie Guan Yin (a kind of tea). We waited for a long time for someone to come by and collect our sheet, but nobody came, so we had to hand it into the person inputting the orders on the computer. The buns were not on the menu, so after we handed the sheet in, we put in an order for the pig buns because when I asked the waitress, she said they were sold out of the monster ones, but still had the pig ones. She even went to go check and came back to tell me that. We were given a receipt of all the food items we ordered on a receipt that was typed up. The pig buns were a separate receipt that was taped to our menu sheet. Many of our dishes came in a timely fashion. We ordered about 6 dishes and finished them all. Also, to add in, they never cleared the finished dishes. The empty plates and steamers kept piling up on our table. It was also odd that our pig buns still hadn\'t arrived. It was 50 minutes since we ordered them. We went to ask the person outside (since not a single staff member was around to serve our table). Suddenly another staff member comes and just puts the bill on our table even though we A) didn\'t ask for the bill B) just asked about our missing pig bun. He answered us by swishing his arm to us and left. A female staff member came to our table telling us that they had sold out of the egg yolk buns. She even accused us of having it on our menu sheet when it was their staff that input the order onto the computer to print the receipt out. They didn\'t even apologize for their lack of knowledge and miscommunication between their staff. All she asked us was who was the waitress that told us that they still had pig buns. This was the worst service I have ever had. Although the food was mediocre and acceptable, their service was horrendous. The tea that we ordered also wasn\'t the best, it left a bitter aftertaste on your tongue.'),(19,831,138,1.00,'2016-09-16','I have had work done from some of the top dentists in the AZ valley and just moved to a new area in Chandler. I would never recommend this dental practice to any of my friends family or co-workers. The customer service was the worst I have ever seen. I spoke to the manager and she did nothing but send me away... They won\'t make it in this business when there are dental practices who care more about the patient than up charging and finding any way to make more money. Impressions  hygienists are incentivized to render unnecessary procedures and might be even getting commissions to pressure you into advanced cleanings \"ethically we can\'t do this until we do this $$$$$$\" careful they throw that word ethical around when they want you to cough up more cash. The only good thing about this business is the fish tank. They will waste your time or charge you the highest possible co-pay so they can max your insurance out and have you in a chair for three hours for procedures you didn\'t even need. 9/23 After visiting my friendly dentist they told me I didn\'t  even need the advanced scaling and cleaning. Impressions Dental is a racket.'),(20,1409,242,1.00,'2017-01-25','We LOVE BBQ! After waiting and watching for months we had the opportunity to eat lunch on 1/23/17. You order, pay, get a number and the food is delivered to the table. Silverware is plastic. Overall VERY disappointing and over priced. We ordered a combo meal which was supposed to come with 3 meats each 1/4 pound. We chose pulled pork, brisket and hot sausage. The pulled pork was probably 1/4 pound but the other two WAY light. Ordering corn bread consumed the one included side. We ordered a second side... the recommended beans. The container of beans was incredibly tiny. The woman at the cash register should not be interacting with customers. She was rude and somewhat snobish. There are two BBQ sauces. The mild has better flavor. They have a nice looking bar that diea not open until 3pm. We won\'t be back unless things change.'),(21,826,859,1.00,'2017-03-19','I\'ve done dozens of escape rooms before and compared against say Escape Games Canada, Omescape, and Mayze, this place leaves much to be desired. Without spoiling any details of the room--- I can say while certain individual elements were somewhat clever puzzles, the overall playthrough lacks continuity and immersion/production value. Without any social media or student discount, 22 bucks is rather steep for such a lackluster experience.'),(22,1244,1512,1.00,'2017-08-25','So.  This morning Kayra and I went to Panagio\'s on McCowan Road for breakfast.  Kayra had a craving for poutine. I placed our order with a waiter at 9:28 AM the order included coffee and tea.Ten minutes later, I asked the waitress for the coffee and tea.  The waiter passed by and said, \"oh I was waiting for a fresh pot\"  (yeah, right lol).At 9:58 AM I decided to ask the cook if my order was in process and if not please cancel.  The owner looked and found no order.   Apparently the order was placed in a takeout package waiting behind the cash.I offered to pay for the coffee but they said it is free.  We left.Comments:  when we arrived we noticed many tables not cleaned after patrons had left.  A fly buzzed by several times. The waiter never once came by to give us an update nor to check on us.After we checked with the cooks and owner regarding our order, it seemed no one cared to remedy or apologised .During my last five visits I noticed a decline in the service.  It seems to get progressively worse with each visit.I will never return to this location on McCowan road.We drove to Sunny Up on Kingston Road where the service was awesome.  In five minutes we were served (one waiter with the same amount of patrons as were at panagio\'s).  Not a big variety on the menu.  Breakfast with an Indian flair hmmm not bad. The regular potatoes served with eggs had onions and green pepper with a touch salt,  tasted great.'),(23,359,23,2.00,'2010-11-09','Got escorted in for free. Hint to get in and not wait in line: Just walk around and look for those promoters that stand about 50 ft in front of it. We weren\'t headed there but a group of girls in club wear, we got stopped so we decided to check it out. I wasn\'t that impressed. There was no real place to dance. It felt like we were dancing in walk ways. So after about an hour or so we left.'),(24,467,1991,2.00,'2011-05-11','I wasnt impressed. The pasties  were so so. Not like they are in the U.P.   Service poor. :('),(25,789,189,2.00,'2012-04-05','We heard about this place through a Groupon offer, so we decided to try it since I love southern barbeque! Therefore, it was with great anticipation that we went to this 2-story restaurant. The atmosphere was typical roadhouse with a lot of music-related posters displayed on the walls. For appetizers, we ordered the Crispy Shrimp and Gator as well as an order of onion rings. The Shrimp and Gator was very tasty with delicious sauces, but the portion seemed small for the price. The onion rings had a pool of grease in the basket, which was disgusting. My teenage son wouldn\'t even finish it.For the main course, we ordered Mississippi ribs, pulled pork and smoked chicken. Everything was nicely smoked, which is an absolute must for me. However, the ribs and pulled pork were rather dry, which made me think that they were sitting under a heat lamp rather than being grilled fresh. Needless to say, this was very disappointing. I\'m glad we had the Groupon discount, since I would have hated paying full price. Lastly, the service was extremely mediocre! Our waitress never even asked if we wanted refills on our water or if everything was OK. Again, very appointing. Oh well ... there are lots of other places that I\'m sure would be glad to have our money.'),(26,1066,1272,2.00,'2014-08-09','After hearing such glowing reviews, my boyfriend and I got up super early to be there when Matt\'s opens. We were underwhelmed. The service was fine. The ambiance was fine too. We just didn\'t think it was anything special. For a place called Matt\'s Big Breakfast, I didn\'t think the breakfasts were very big, and neither were the options. It wasn\'t bad-it just wasn\'t great.'),(27,1367,1506,2.00,'2015-02-23','I was kinda disappointed. We walk in to the bar and waiting almost 10 minutes before the bartender even acknowledged us. He said he would be right back. 5 minutes later he was.We ordered drink # 1 and finished it. Waited about 10 minutes and then he came back and we ordered another. I drank that down and then the wait begins. Almost 15 minutes later, he came back. I was fuming. This is a customer service industry. Another thing that made me mad was that their was not many people there...'),(28,904,1569,2.00,'2016-01-30','I just ordered from Ubereats. And my order came about an hour and half late. I called Uber to see what the problem was, and they just offered me free credit. When the delivery man came to my door he told me he had to wait 45minutes just for my order! My food was close to freezing. If you can\'t make the food and have it delivered on time, you shouldn\'t even have your business on Uber. The food wasn\'t terrible, but I think if I ever try it again, I\'d eat it at the restaurant.'),(29,1407,119,2.00,'2016-12-22','Red lobster. You would think that since they\'re name is red lobster they should have pretty good seafood. There are unlimited biscuits that you can eat during your dine in. They were freshly served as they are warm and soft. You can\'t eat too much as it is very oily, but nonetheless, still tasty.I ordered the Fire Grilled Lobster Shrimp and Salmon with broccoli and the roasted potatoes as sides. The shrimp was pretty good, very flavourful and the texture was fresh. But then everything else just kept going downhill. The broccoli was frozen broccoli, the roasted potatoes tasted like they were baked, put into the oven, frozen and rebaked and was put into the microwave. It was way too dry and tasted very starchy. It was also way too salty. The lobster tail was the end. It wasn\'t fresh as the meat was kind of mushy in texture. As for the salmon, it was pretty dry. For something that the waitress recommended, I would\'ve thought it would\'ve been made better. We also ordered the four course meal that is only available from Mon-Thurs. You get to choose a soup, a salad, an entree, and a dessert for $22. We chose the clam chowder soup, Caesar salad, shrimp linguine and the brownie. Another set, we chose the chicken linguine. The soup and salad weren\'t bad, but the pasta was very mediocre. The brownie was also pretty good. However, what made this experience terrible was the server. Prior to us ordering, she was friendly and gave us recommendations since it was our first time here. After we ordered, she barely came to our table unless it was to give us the food. Often times we needed our water to be refilled, and she didn\'t bother to glance at our table. Near the end after our entree, she even asked us if we would like our desserts packed up to be taken out. We never told her to pack it for us. Not only was her attitude towards us very negative, she seemed to be opinionated towards our food choices and wanted us out asap. I won\'t reveal her name, but I definitely won\'t be back. In terms of food and service, I\'ve definitely experienced better.'),(30,1843,636,2.00,'2017-07-13','I\'ve been giving 3-5 star reviews lately. My first 2 star review...I try to do give an honest and fair review based off of a couple of experiences...I\'ve been to many Tropical Cafe Smoothies...this review is only in reference to this particular location...so each time that I went here, from entering to leaving has been nearly the same experience...I\'ve gone here at different times of the day and each time, inside and outside the area looks pretty dirty. The neon lights weren\'t even on. You can see with my photo\'s that I\'ve included...There\'s not 1 worker there that seems to like working there. Each time, while I\'m in line, someone is talking about their personal life problems...In my opinion, it\'s ok to talk about whatever you want to talk about, when there\'s no customers around, but when there\'s customers. It\'s best to try to be as professional as you can. I get everyone gets a bad day every once in a while...I\'m not knocking on the taste of my smoothie...because it\'s been consistent. I usually just get the Peanut Paradise with Whey protein........my location of preference would be either the one on Blue Diamond or the one on Las Vegas Blvd near the mall and Canes...It\'s weird how this location has pigeons, reminds me of the Bay Area, where I\'m originally from, without that stank ocean smell........This location is in Summerlin... Summerlin I was told is like an upscale neighborhood vs North Las Vegas, Henderson and even Southern Highlands...just 2 stop lights up the street and the complex is completely clean. This location almost feels as if you\'re in North Las Vegas off Craig...but yeah, I also noticed there were a lot of low rating scores at this particular location...if you don\'t believe me. Feel free to check it out yourself...'),(31,1407,494,2.00,'2017-07-13','Our family goes to red lobster every month and last week\'s bar harbour bake was very disappointing. For $32.00, instead of 3 full sized scallops, they now replaced it with about a dozen puny little ones that you can buy for a dollar a pack at any grocery.  The size of their shrimps have also reduced to smaller than medium. The amount of pasta has also gone down, making this dish entirely not worth the money. I don\'t care about your cheap mussels.'),(32,813,1942,3.00,'2009-05-05','I love the Bloor and wish I could make it to more showings, more often, but their wonky movie times make it difficult! On the plus side, when I actually manage to find a movie I want to see there at a time that I\'m not at work, it makes for a whole event, usually with a group of people. The admission charges are incredibly reasonable and the popcorn is 20 times better than the stuff you\'ll find at the bigger theatres. That taste is the difference the love of a small theatre will make.'),(33,1728,1942,3.00,'2010-05-27','The self-brewed beer is very tasty as is the pub food, although the selection is limited. Their locations are always huge so the wait for a table is usually either short or non-existent. Seems to be ideal for after work drinks and great for large groups.'),(34,1824,1073,3.00,'2010-07-27','I would say its a fun place but similar to everything in Vegas, lets just put somebodys name on it and try to sell some t-shirts.  The food is decent but I\'ve been there once and don\'t need to go back.'),(35,339,1709,3.00,'2012-09-12','The smell of jerk spices drew us into this place, and it was pretty good but not great.  The meat is beyond compare- savory, flavorful and satisfying.  The sides are a little disappointing- the plantains are delicious, but the rice and vegetables I had weren\'t that great. The service was OK.  We all agreed that it wasn\'t as good as we hoped but that we felt it deserved another chance.One note: we tried to redeem a Restaurant.com certificate and the owner said they had stopped accepting them months ago.  She said she had asked Restaurant.com to take the offer down, and she refused to accept the certificate.  I called Restaurant.com and asked for a refund, and they would only let me exchange it for another restaurant.   I continued to check for a week or two afterwards and the offer remained up.  That was a few months ago, and looking at the website now, they still have the offer, but in a smaller amount.  If you are thinking of purchasing a Restaurant.com certificate for this restaurant, you may want to call them first and make sure they still accept it.'),(36,101,1380,3.00,'2016-01-02','Interesting concept. Food was alright....not awesome, but fair. Stopped in while traveling....like the atmosphere and the no plate get messy and enjoy way of doing things. Had mussels and king crab with the trifecta spice.....would eat here again if for nothing else the fun of it.'),(37,503,1183,3.00,'2016-03-08','Came here with 4 kids, ordered 4 medium blizzards, i got 4 large blizzards and got charged for the large, luckily they were running a buy one get one for .99 cents deal. Kids enjoyed the blizzard.  Place was clean, lots of seating inside. Staff was friendly enough.  I asked for 3 covers because kids couldn\'t finish the large, and got the covers with no attitude.Will try this place again.Seating outside, and parking onsite.'),(38,331,1183,3.00,'2016-03-08','Was here a few months ago. First time trying Canadian Thai.Staff and Service was good!! The accommodated a table for 12, and it did get busy afterwards.Now to the food....As mentioned in other reviews, its CANADIAN Thai. If you are expecting authentic Thai, DONT!!Otherwise, nothing wrong with the food.I like authentic, so i will be going to another place for thai.I will come here for the good service, and decent Canadian food.  :)'),(39,1605,1183,3.00,'2016-03-22','I\'ve probably bought from Steelcase for 6-7 vehicles.  Great prices a few years ago.  Service was good back then. I would not look anywhere else for tires.The past 2 years, i went to get a quote, their prices were not great, and i found that they try to push certain brands.  Maybe for kickback from the manufacture, not sure, but i went in to get quotes for one brand and model and they recommended another brand and model.Also, when you walk in there, the counter staff don\'t acknowledge you because they are all busy on the phone.  Walk-in customers i think are more important, cause we made the effort to drive there and walk into your store.Anyhow, i started shopping at another tire store, because tire prices are more competitive now and i hate long wait times.'),(40,101,812,3.00,'2016-10-18','First time awesomeSecond  time my meal came half frozen after a very long waitby the time we got the servers attention my family was finished with their meals so the offer to have it re cooked seemed a little off so every one could sit there for another 30 minutes, then watch me eat....uuumm no thanks'),(41,1737,220,3.00,'2017-09-11','Orders 4 tapas here. Fries, the triple cones, black grouper, and strawberry parfait.All of them were decent. If need to rank them, the desert was the best and the triple cones was the worst. Prob different than a lot of reviewers. While checking the reviews to order food, truffle fries were one of the top. However since we Came to visit charlottes from Chicago, food in Chicago was much better.  Truffle fries you can find in most dt restaurants in Chicago. This one here was just normal level. The three cones were one the the top as well. However feel just so so. The tuna was the worst. You can\'t feel the tuna taste when eating with sweet cone. Parfait was really nice. Yogurt and goat cheese with some nuts in side made it fresh and thick creamy. Nice home made dish. Overall, you can\'t compare Charlottes food level with other big cities\'. However this restaurant still serves the nice food in the city.'),(42,1314,511,4.00,'2009-08-06','I just tried this place last week.  The quality and value is hard to beat.  Recommended.  Though I wish you could order online.'),(43,968,608,4.00,'2010-07-06','As a new pet owner, I can say I really enjoy taking my pup to the Lakewood Dog Park. The people who enjoy the park are very respectful of the space by cleaning up after their pets and keeping water bowls full for the dogs to share. Like any dog park, there are times it can get crowded, and considering the park is located next door to a water treatment plant, the area can get somewhat pungent, but all things considered, this is a great resource to dogs and dog enthusiasts in the Lakewood / Rocky River / West Park areas.'),(44,1075,516,4.00,'2012-08-02','I enjoyed my visit here. Very friendly staff and pretty clean too. The food was good and you really can\'t complain about it.'),(45,1952,359,4.00,'2012-08-13','Good food, service and also a decent drink special. I typically go in and hang in the bar area (always clean, and friendly service) but have also entertained work folks there and has always been a hit.  Wings are good, with plenty of flavors, and you have to try the buffarella (sure i spelled this wrong). regardless, good stuff at Wild Wing.'),(46,906,931,4.00,'2013-05-09','Been there twice for lunch buffet, it was quite good. Specially desert and Shrimp fry'),(47,1978,1043,4.00,'2013-09-26','I hit this place for lunch a couple of time a month.  Food is standard fast food teriyaki, and gets 3 stats, but young kid who works the counter is well mannered and friendly.  That\'s pretty hard to find in a service worker these days.  He gets 5 starts'),(48,867,1946,4.00,'2014-06-07','Fresh toppings... Hormone and antibiotic free DELICIOUS patty fried crispy on a hot griddle. Excellent value!'),(49,1981,462,4.00,'2014-09-27','Excellent! Could have been five stars!!My friend and I found on Yelp, looking to get off the strip. The place was quiet and mostly empty but we did arrive before 6 on a Sat which is def early for Vegas. Right away we noticed the sushi chefs. These guys are authentic! It\'s harder to describe but trust, you will understand when you see. We ordered a variety of apps and sushi and it was all amazing. Not a big desert fan and I think there were four to choose on the menu but the waitress highly recommended so we split one. Very unique and as amazing as the rest of the meal. We were looking to get away from the Vegas strip pricing though and it was not cheap. Cheap can be a dirty word though and I am a believer you get what you pay for. We tipped well and it was about $180 for the two of us inc one bottle $7 sake. Ok, it could have been even worse on the strip, but the food could not have been better. If you are looking to save I can\'t recommend but otherwise I recommend very highly!!'),(50,703,748,4.00,'2015-12-28','The Gap in the forum shops has some good finds. It\'s large and has a good variety of inventory, including some GapBody items. We came after Christmas and the whole store was on sale.I got some nice soft grey denim jeans for like $20 after the sale. Gap has really improved their clothing in the past few years and I find myself buying more clothing these days.'),(51,1049,808,4.00,'2016-02-24','Food Service: ExcellentFood Quality: ExcellentRestaurant Decor: Hip, UpdatedI like that there are no grills on the tables. I have young kids so the oil spatter and hot grill freak me out. They cook it all for you in the back, deliver it to your table, hot and delicious. And your clothes don\'t smell like bbq when you leave. We were seated right away at 5:30pm but the house filled up fast on a Saturday night. Plenty of parking, and the place was easy to find. I didn\'t give Mamaoh the fifth star because there wasn\'t that spark. The panchan was good, but they had a slim selection of four items (kimchi, brocolli, daikon and spicy tofu skin). Be Advised if you are NOT a Vegas Local (and don\'t have a car). This is a heck of a long Uber ride from the strip. Unless you have a car, you will be pissed that you came all this way.'),(52,1759,46,4.00,'2016-04-14','So I first went to this place when it was purely just a popcorn place and then once they changed their brand I thought the popcorn side was done so I unfortunately didn\'t go back for like a year. Luckily I came across it and decided to call to see if they still had popcorn... AND THEY DID! I love the popcorn. It\'s an amazing treat and just amazing. I only get the supreme ones with chocolate on them. White tie tux is my favorite but the mocha almond is my sisters fav. Both are fantastic. My biggest problem is the pricing. Not mad with the magnitude of prices, but I dislike the changes in prices from sizes compared to supreme to savory Flavors. I do not understand how a large for supreme is $7.50 and a extra large is $21.50. 3x the cost and do I get 3x the amount?!? But what is stranger is that the savory the price from large to extra large was only 80% more. Please fix this as it aggregates my math side. Besides that! Love the place.'),(53,80,1283,4.00,'2016-07-03','Consistently good food and excellent service! I love the new modern decor and it\'s always clean and comfortable. Easy to read menu with good descriptions of what you\'re ordering make decision making easy. Reasonable prices, great service, good food, and hearty helpings will bring me back again next time I\'m in town!'),(54,188,1569,4.00,'2016-09-17','I came in here today (Saturday) because the two Japanese places I wanted to eat at were closed for lunch. I\'ve been here before but it wasn\'t as great as it was today. I ordered Agedashi tofu and Bibim Nengmyun. Most people would think the agendashi tofu is average here, but the one I ate today totally hit the spot. They used silky soft tofu and fried it in a light batter. I asked for a less spicy Bibim Nengmyun because I can\'t eat very spicy things. But the kitchen was accompanying of my sensitive tastebuds :) I had to get seconds on the side dishes because they were sooooo good!'),(55,1043,1183,4.00,'2016-12-17','Pub style seating and atmosphere.Came here with some co-workers. Waitress was nice, and attentative.I ordered the blt with vegatable soup.Soup was nice and hot! Blt was pretty good!Washrooms are clean and stocked up. A bit cold though.Good place to go with loud friends for drinks and pretty good food!I enjoyed my first visit.4 - 4.5 stars!'),(56,467,1588,4.00,'2017-06-21','Cool place for a beer and some mouth chunks. Baked all ways with many flavors to offer. Their menu has lots to choose from, we ordered 7 different plates for only 4 people and we had a great time drinking and eating.'),(57,359,61,5.00,'2008-01-08','For a place that is modeled after a Brothel, I never thought the thing that would stick with me the most would be the food......Me and my friends went and hit this place up for dinner the day after it opened and were pleasantly surprised. We went expecting sub par food engorged in a world of burlesque dancers and got amazing food with a subtly intimate decor. Yes there are viewing windows were every twenty minutes or so a young woman in lingerie would come out and to things like sew and try on clothes. But that gets old after the first time you see it .What the true appeal to this place is the food, for an appetizer we had cracked pepper chicken wings that were full of flavor and the spice was not over powering. For dinner I had the beef braised ribs, and they were truly not what I expected. I figured they might have a bone, but no they were three little pieces of meat on top of mixture of squash and corn.At one point I actually had to ask the waitress what the hell I was eating because I had no idea that corn and squash were supposed to go together. But they pulled it off and I actually left full of a rather small a la cart portion. Its a little pricey, but nothing too over the top.All in all it was one of the better meals I\'ve ever had and it was completely out of left field. I guess it doesn\'t hurt to have celebrity chef Kerry Simon at the helm of the menu.Bottom line go here because you have a touch of the perv in you, go again because you enjoy a great meal.'),(58,1624,1279,5.00,'2011-11-21','This place is awesome! My boyfriend Charles and I just drove 4.5 hours from California and it was 7:40pm and we were out-of-it and starving. We were going to take our food to-go as BFG closes at 8pm, but the owner Jin was soo nice and understanding, he still let us eat-in. I mean the hospitality was AMAZING...and so was the food! Chicken strips can be easy to dry out, if not done right, but man...whether it was fried or baked these strips were always moist and seasoned just right. My boyfriend loved the fried because he loves panko breaded chicken :)  The mac n cheese....ohhh gooey cheesy goodness. Actually baked in the oven.well, long story short, we were in town for less than 48 hours and we managed to come back and eat here twice! Thats how good it was. It was the best $6 meal I\'d had for as far back as I can remember...The simplicity of the meals is what makes this place best...The chicken is really the star here. Plus, the portions are perfect.  Fantastic food at a fantastic price...oh it was AWESOME.Thanks Jin! Next time were in town, we\'ll be back  :D'),(59,213,1157,5.00,'2012-06-30','So I stayed here for a business trip I took to Montreal. The hotel was clean I loved their free breakfast. I did not like their restaurant. Food was not good and it was overly priced. If you are up to walking about 5 minutes. There is a convenient store (maxin I think its called) near the traffic circle, there is also a subway, a bar, a Chinese buffet, and a gas burger joint. So walking distance there are a lot of alternatives for food.Overall, great experience and great hotel to stay in. Staff are also really friendly.'),(60,785,1261,5.00,'2012-11-01','Great facility for my son to play Water Polo but  a long drive from Summerlin'),(61,1070,931,5.00,'2013-08-24','Been there on Saturday noon. It had hell lot of items for buffet n most of them were good.'),(62,467,984,5.00,'2013-09-01','Always a good time. Excellent soup, especially the tomato basil. Comes with fresh homemade bread! Great food, drinks, music. I\'d recommend this little hole-in-the-wall to ANYONE :)'),(63,1551,410,5.00,'2013-10-15','Wow what a nice find in FH. The Sangria and afternoon Tapas plate for $12 was wonderful. Visiting from Chicago and highly recommend - will be back on our next trip.'),(64,1433,288,5.00,'2013-11-23','The best Mexican food I\'ve eaten at a restaurant. It\'s as close to authentic Mexican food as you can get. AMAZING... It\'s the same food as the downtown location. Even the enchilada sauce is authentic and homemade, not that canned stuff you get at other restaurants.'),(65,309,118,5.00,'2014-06-22','My boyfriend and I used to live across the street from this place. There\'s a circle K right by us too, but we would ALWAYS go here. The owner is so friendly and remembers us every time. Super awesome beer selection and a build your own 6-pack for super cheap. Good prices, friendly staff and super convenient!'),(66,40,1045,5.00,'2014-06-28','Just moved in from Vegas & needed a hair cut pronto as I was desperate for relief from the heat (Vegas heat is not as bad as Phoenix heat....). I have THICK, curly hair and was hesitant to try someone I\'m not familiar with. However, upon reading the reviews I decided to try Ace\'s as it was not too far from my home. I had waist length hair (again curly, frizzy and thick) and was trying to go for a shoulder length cut. I walked in without an appointment and was seated immediately (I was worried about the wait time as it was a Saturday). I\'m not much of a conversationalist so I can\'t really judge on customer service in that way, but I was greeted nicely and my stylist asked all the right questions. The shop itself was pretty neat. Lab with the green tuff of fur included :) The end result was AMAZING. I love my hair now and I don\'t even think I\'ll miss my long hair. I think I just found my AZ shop!'),(67,80,465,5.00,'2014-12-20','We had our Christmas party there last night, what a great time.  Good food, good drinks and the dj was so much fun...Thank you to Aloha Kitchen what a wonderful time'),(68,1718,408,5.00,'2015-02-12','Truly a 5 star experience!!! Ten served up an amazing meal. We\'ve never been before but live nextdoor and thought we\'d try it out. The HUSH PUPPIES are to die for! And don\'t even get me started on the Pot Roast that melts in your mouth. You won\'t be disappointed. My partner and I chowed down leaving nothing but empty places. Probably not proper etiquette to use my finger to wipe the plate clean... but that\'s what I did. We ended the meal with the PB and J dessert that satisfied our need for something sweet. Can\'t say enough about this restaurant. Refills upon refills ready to go. Chef walking around to make sure everyone is enjoying their meal. And make sure to ask for ELIZABETH! She\'s truly a gem to this fine eatery. I give TEN a ten out of ten. I think it\'s clear that we\'ll be back for more.'),(69,1718,1084,5.00,'2015-03-25','Great spot. Not an extensive menu but everything was great. The hush puppies aren\'t like anything I\'ve ever had. I normally don\'t care for them. Their\'s were awesome, bacon and chives with an almost liquid core. Owner is very charismatic and you can tell this place is his passion. He also has a great selection of music playing in the background.'),(70,1066,1401,5.00,'2015-05-27','When in Phoenix, this is THE place to go!The hot cakes? AMAZING! Soft and fluffy and heavenly and sooo good!!! everything was good, even the maple syrup. I also ordered the lemonade...just as good! it was made with real honey not sugar. Forget any of those breakfast chains, dont even think about it just get yourself to Matt\'s!Do expect a wait, likely and hour in the morning, though if you come in later (got there closer to noon on a week day) the wait is much less and the ambiance less hectic also. The decor is cute and everyone was very friendly. It\'s a must for sure!'),(71,302,1506,5.00,'2016-01-06','Great and fast service. Real easy to work with. Had my project done ASAP'),(72,101,1288,5.00,'2016-01-22','I happened on this restaurant today when I was apartment hunting.  I had had the same type of meal at LA Crawfish in Tomball, TX.   The Angry Crab, however, had a larger selection of fish and seafood as well as sauces and intensity of heat.   I had the shrimp with a potato and small ear of corn.  I got the Trifecta Sauce and the medium heat.  It was SO good!   The medium heat was pretty spicy, but once I got used to it, I loved it.If you are looking for your typical Louisiana crawfish or shrimp boil, this is not the place.  Their shellfish comes in a plastic bag with the sauce you pick.  You don\'t need to dip it in a remoulade sauce or cocktail sauce.  It comes \"swimming\" in the sauce you select.They have raw oysters, poor boys, gumbo and more.  The atmosphere is very relaxed.  You can\'t go wrong here!'),(73,1771,1762,5.00,'2016-02-22','The best speakeasy bar I\'ve ever been to. Great drinks. Great room. Great atmosphere. When friends or family come to town, this great spot is on the to do list. A must for anyone looking for a good drink.'),(74,1205,1183,5.00,'2016-03-22','I\'ve had work on 2 of my cars in the past done here. Both times, very happy with their work!!Nice clean jobs on both cars.  I like when they ask me how i want the positioning of the exhaust tip, before they complete the job. They want you to walk away satisfied.On both cars, i\'ve never had to go back to fix anything. Solid job!!Also, they don\'t try to upsell, they do recommend.  On one of my car they recommended that if i get a high flow cat, it would help with my magnaflow exhaust that i was putting on, then they checked and the oem was already a high flow. They didnt say, that the magnaflow highflow cat was better than the oem.  So they didnt try to upsell the magnaflow cat.This review is for the work they did back in 2001/2002.  Hopefully nothings change since then.If i did ever need another custom exhaust, i would go back here!!'),(75,101,421,5.00,'2016-05-05','I took my son here and he is a very picky eater for a 10 year old. We were seated right away. He loved the idea of being able to write on the wall and the table and not get in trouble. This was my second time here and his 1st. We sat down and almost right away Dawn (our server) came over with a smile to take our order and ensure that we were taken care of. She was amazing! The service was great, the food was incredible and she actually was even able to convince him to try the crab. Would absolutely recommend going there and you must ask for Dawn!!!! It\'s an experience.'),(76,1348,43,5.00,'2016-05-07','Best Postino yet!! Fantastic space with multiple patios & the same great atmosphere that we\'ve always loved about Postino Arcadia. Big thank you to Craig & Upward Projects as we\'ve been begging for a Scottsdale location for years!!'),(77,1185,1996,5.00,'2016-06-05','Eric not available when I got there this afternoon, so I try Ben\'s 90 minutes massage..Still five star, really good! The massage level in this store is really good, and price is reasonable, the most important is the store is really clean, now it\'s my favorite massage store in Las Vegas.'),(78,1673,1448,5.00,'2016-07-13','This is the best sushi place in the west valley! Anything you order- sushi, noodles, even the edamame is super delicious!'),(79,1104,1346,5.00,'2016-07-14','We spent months browsing jewelry stores in several states and could never forget the very first engagement ring I loved - we saw it right in our own backyard in Vegas at Michael Minden.When my fiancee proposed it was the one he had, I loved it - I love it more each day and I get SO MANY compliments on it. It\'s breathtaking. Michelle helped him pick the center stone. She helped us when it was time to design the bands to match it. She doesn\'t mind when I randomly pop in and ask for it to be cleaned and checked out to ensure no loose stones.I am SO glad he bought my ring in our hometown and with Michelle\'s help. I love wearing a custom design that no one else will ever have. Thank you MM and Michelle!'),(80,1668,1588,5.00,'2016-07-29','Good service down to earth and real family business. They got momma working the Sushi bar... We wanted something chill, good food, light noise and pow it\'s here.'),(81,691,1370,5.00,'2016-08-13','Went there for a balayage hair by Annie and the result is amazing! My hair is dark black and she was able to give me a nice ashy blonde at the tips.I was offered a drink the minute I walked in and the staff is very nice. Really great customer service and Annie is very talented!'),(82,1049,188,5.00,'2016-09-10','Came here for lunch yesterday and i was pleased with their food. My girlfriend got the stone pot bibimbap and I got the fried rice and kalbi combo. Their bibimbap was really good and tasted very fresh. The combo had a good amount of kalbi. This is one of the few places that aren\'t greedy with their portions and you\'ll get your money\'s worth when it comes to ordering meat. Definitely will come back again.'),(83,730,30,5.00,'2016-10-08','Stopped in here for the first time to grab a gift for my boss. The staff is great and super friendly. The young woman who helped me suggested one of their grab and go bouquets (which are stunning and only $20). They also allow you to create your own bouquet with their fresh seasonal flowers if you\'d like. Great local shop. I\'ll definitely be back!'),(84,665,361,5.00,'2016-10-21','Best BLT I\'ve had in quite awhile. Really tasty bacon and obvious that ingredients are fresh and made to order.Cute small shop with imaginative decor. Situated in an industrial/office complex, so don\'t let the location mislead you into thinking you\'ve gone to the wrong place.Definitely worth your appetite and $.'),(85,272,1971,5.00,'2016-10-23','This was my favorite part of the Montreal food tour. We went to the restaurant as soon as they opened and on the weekend so there was no wait. Ambience was very hip and casual. It was my first time having fish and chips. Beer battered cod was definitely the way to go. Well flavored. Fries tasted double fried as they were perfectly crispy. Prices were very reasonable. Definitely would go back!'),(86,1185,309,5.00,'2016-11-12','Super great reflexology place. A few miles further than my other place but worth it. $20 price. Don\'t buy Groupon because it\'s the same price and that way you get credit on card they give. Buy 10 and 11th is free. Very clean and great techniques she used. I had Bella and plan to return very soon!'),(87,242,617,5.00,'2016-12-20','I just saw the Charlotte Ballet\'s Nutcracker here. WOW! The theater is clean and easy to get to.They serve beer, wine, soda, water and cocktails for resasonable prices. And you can bring it in the theater. We had seats on the orchestra level far left and had a great view of the stage.  They had plenty of bathrooms for intermission and even had ushers in the ladies room to help keep things moving (help you find an open stall). We did valet park at a restaurant across the street because we had dinner before. (Check out Capital Grill). Then when we left. There was a street band playing right outside. It added to the festive atmosphere. Enjoy!'),(88,1699,98,5.00,'2016-12-25','Not sure what\'s not to love about Tacos Mexico. Gotta be the best Taco shop in LV. Lengua, tripa, al pastor, carnitas. Habanero salsa and see you later. It\'s without a doubt the spot.'),(89,1409,1923,5.00,'2017-01-25','I\'m not sure why the reviews from here are so bad because this place is awesome!! Such a cute place!! Great food the Texas way! Which I was born and raised! The owner sat with us and was really nice and asked how our food was. The restaurant is super big and full of cool places to sit and things to look at. As I was walking out Keaton offered us some free ice cream! And it was so good and he was so sweet and nice. Just try it yourself! Will be going back!'),(90,1116,673,5.00,'2017-03-04','Went in last night to meet my wife. She had an incident where someone stole her purse. The management and staff were incredibly helpful and supportive. Due to their efforts we were able to track down the person and all her things were  returned! I just wanted to take the time to thank them!!! The bartenders and managers Are top notch!'),(91,843,1281,5.00,'2017-04-12','I ordered during the Holly Week, in the middle of a big storm. They emailed that they will b e about one hour late, given the circumstances, and they made up for it offering a 15% DISCOUNT FOR THE NEXT DELIVERY,i RCEIVEd TWO MORE CALLS, ONE FROM THE GROCERY GUY AND HE THIRD FROM INSTABUGGY. eVERYTHING WAS FReSH, PEFECTLY PACKAGED. i WISH i KNEW ABOUT THAT SERVICE earlier. Their delivey rates ar the best; they are by far the best with their one hour delivery. They offer bout six groceries to chose from, including LCBO. I hope they will have more customers, to stay in business for ever.'),(92,372,351,5.00,'2017-05-05','If you want quality workmanship with a smile, I would highly recommend going to Chagrin Shoe Repair.  I have been utilizing their services for 8+ years and I have been more than pleased by all of their work.  I take high end products to them - Jimmy Choo, Balenciaga, Kooba - because I would not trust anyone else to complete the repairs.  They are reasonably priced and I am a firm believer in \"you get what you pay for\".  I even drive 20+ miles to take my belongings to be repaired . . .  I pass many repair shops in my drive to come see them and I would never go anywhere else!'),(93,604,309,5.00,'2017-05-28','Ate here last night on a thurs 530 or so. Excellent BBQ place. Very casual. A little off the strip near koval and flamingo. Best ribs and chicken around. Super great sauce and sides come with it.The price you can\'t beat. Simple menu and food came super quick and service was fabulous. Will be back there soon and I am a local and usually try to avoid the strip but worth driving to this place. It is in their small casino and I did read that no one under 21 is permitted so important to know if you plan to bring kids.'),(94,832,373,5.00,'2017-06-02','Jay is the best!  We buy and sell cars quite often and Jay is knowledgeable and helpful. We know we are going to get fast, accurate service. And he\'s pleasant and always remembers us.'),(95,36,926,5.00,'2017-06-09','Just walking in, the place smells fantastic. Great food. Warm, welcoming atmosphere. First timers try the feast. Great to bring a date.'),(96,1503,1355,5.00,'2017-06-16','I highly recommend Sergio for your mortgage lending needs. He was very thorough and efficient, and he kept me in the loop at all times.  As promised, he had my loan closed within 30 days of locking the rate.  He is a true professional!'),(97,1028,588,5.00,'2017-07-13','Just found this place. Like to try new places to groom my dogs. This has been the best place to bring my dogs. She does amazing work, and actually listened to how I wanted my babies groomed. I recommend mad about dogs to anyone. I will be coming here from now on'),(98,930,488,5.00,'2017-07-13','We had the perfect dinner experience here. The days special orecchiette smoked chicken with the rose sauce was as good as it gets. The atmosphere was warm and intimate adding to the experience. We loved it here'),(99,1129,1510,5.00,'2017-07-16','I had calles ahead of time to see how much it was to replace my phone battery. I had called around and mobile squared gave me the best price. I went to get it replaced and rather than take my money, the associate went through with me on how to make sure my phone was optimized and tips to try saying the battery may not be the problem.  They couldve just taken my money and gotten rid of me. Instead they gave me great advice and took nothing! I would trust these guys anytime you have a problem with your phone because they\'re clearly very honest in their work!!!'),(100,1722,175,5.00,'2017-07-16','THE BEST BURGER IN THE \'BURGH - HANDS DOWN!! Great flavor - always perfectly seasoned and cooked to your preference.  We have been enjoying Tessaro\'s for years and we have never had a burger that was cooked incorrectly.  The home fries and the potato salad are my favorite side dishes. The salads are also amazing - the strawberry vinaigrette is mind blowing!! BONUS: They have ICE COLD Rolling Rock pony bottles to enjoy with your burger!!'),(101,304,1367,5.00,'2017-07-21','Such amazing ice cream and incredible staff! Love their weekly soft serve. Vegan friendly Pandan Coconut is awesome too. Great place for the neighborhood :)'),(102,1139,90,5.00,'2017-08-19','Antjuan and the A team did an awesome job planting our trees. They were quick and efficient. Recommend them anytime to do your landscaping. Thanks you guys and thank you moon valley nursery.'),(103,980,1140,5.00,'2017-09-28','The macarons here are amazing! I had gotten a box from here and from Amelie\'s to compare. In one sitting, I ate both boxes and hands down, Le Macaron\'s were so much better- moist inside and flavors were on point.'),(104,1809,1282,5.00,'2017-11-06','Reaonable prices very cheerful nice people and great service I am a total fan just tried it this week for shirts! LOVE IT WILL BE BACK THANKS JORGE!'),(128,3,2051,NULL,NULL,NULL),(129,3,2052,NULL,NULL,NULL),(130,3,2053,NULL,NULL,NULL),(131,3,2054,NULL,NULL,NULL),(132,3,2055,NULL,NULL,NULL),(133,3,2056,NULL,NULL,NULL),(134,3,2057,NULL,NULL,NULL),(135,3,2058,NULL,NULL,NULL),(136,3,2059,NULL,NULL,NULL),(138,13,2066,NULL,NULL,NULL),(141,80,1,NULL,NULL,NULL),(142,690,1,NULL,NULL,NULL),(143,692,1,NULL,NULL,NULL),(149,2,2067,NULL,NULL,NULL),(150,1,533,NULL,NULL,NULL),(151,2,795,NULL,NULL,NULL),(152,2,1291,NULL,NULL,''),(153,493,1291,NULL,NULL,'');
